import React from "react";
import Popup from "reactjs-popup";

const sendURLPopup = () => {
  return (
    <Popup
      trigger={<button> Trigger</button>}
      position="right center"
    >
    <div>
      <div class="ui input">
        <input type="text" placeholder="Search..." />
      </div>
    </div>
    </Popup>
  );
}

export default sendURLPopup;
